import React, { Fragment } from "react";
import { Link } from "react-router-dom";

const BackTo = ({ children, sx, toLink }) => {
  return (
    <Fragment>
      <Link
        className={`border flex justify-center items-center border-gray-300 rounded-md px-3 py-2 mb-2 ${sx} scale-105 transition-all duration-500`}
        to={toLink}
      >
        <p className="text-xl">{children}</p>
      </Link>
    </Fragment>
  );
};

export default BackTo;
